import React from "react";
import StarFull from "../../images/starFull.svg";
import StarEmpty from "../../images/starEmpty.svg";

export default function Rating(props) {

    returnNumberStars(props);


    return (
        <div>
            <img src={StarFull}
            alt={StarFull} />
            <img src={StarEmpty}
            alt={StarEmpty} />
        </div>
    )
}

function returnNumberStars(stars) {
    console.log(stars);
}
